const MoveList = ({moveList}) => {
    const sortedMoveList = moveList.sort((a, b) => {
        if(a.level > b.level) {
            return 1
        } else {
            return -1
        }
    })

    const mapMoveList = sortedMoveList.map(move => {
        return (
            <div>
                <li>{move.name}</li>
                <li>{move.method}</li>
            </div>
        )
    })

    return (
        <>
            {mapMoveList}
        </>
    )
}

export default MoveList
